    constructor(){
        super()
        this.state = {
            onlineUser:0
        }
    }

    goOnline = ()=>{
        this.setState({
            onlineUser : this.state.onlineUser+1
        })  
    }

    getEmail = (e)=>{
        console.log('aaa',e.target.value)
    }   

    render (){
        return (  
            <div>
                {this.state.onlineUser}
                <button onClick={this.goOnline}>GO ONLINE</button>

                <div ClassName="row">
                    <input className="form-control" onChange={getEmail} />
                </div>
            </div>
          )
    }


} 
export default Signup
